body:
change type of `Default` to `any`

**TypeScript Version**
2.4.0

previous it is:
```ts
type Default = any;
```

it may result in code below to be error: 

```ts
import {Db} from 'mongodb';

interface Format{
    a:string;
    b:number;
}

declare let db:Db;
db.collection('Test').find({}).next().then(doc=>{
    let a:Format = doc;
})
```

Make this PR is because there are too many files to modified as `.collection<any>` after update `@types/mongodb`
So for better backward compatibility, maybe `Default` is better to be `any`.

Using this library as-is doesn't allow declaring a variable for the actual store.

```
const mockStore = createMockStore<State>([thunk]);
let store: MockStore<State>;

beforeEach(() => {
    store = mockStore(initialState);
});
```
This should be possible imo.

